<style>
  :root{--bg:#020204;--panel:#04110a;--accent:#00ff6a;--muted:#6fbf9a}

  .logo img{width:100%;height:100%;object-fit:cover;filter:drop-shadow(0 6px 20px rgba(0,255,106,0.08))}
  .body{flex:1}
  .title{font-size:18px;margin:0 0 6px;letter-spacing:1px;font-weight:bold;color:var(--accent)}
  .subtitle{color:var(--muted);font-size:13px;margin:0 0 16px}
  .key-box{background:#001610;padding:18px;border-radius:10px;border:1px solid rgba(0,255,106,0.2);font-family:monospace;font-size:18px;word-break:break-all;min-height:56px;display:flex;align-items:center;justify-content:space-between;gap:12px}

  .btn{background:linear-gradient(90deg,#00ff6a,#07b47a);border:none;padding:10px 18px;border-radius:8px;color:#001a10;font-weight:700;cursor:pointer;margin-left:8px;transition:.3s}
  .btn:hover{box-shadow:0 0 15px var(--accent)}
  .small{font-size:12px;color:var(--muted);margin-top:10px}

  @keyframes neon{0%,100%{text-shadow:0 0 6px rgba(0,255,106,.6)}50%{text-shadow:0 0 18px rgba(0,255,106,.95)}}
  .title{animation:neon 3s infinite ease-in-out}

  @media (max-width:680px){
    .card{flex-direction:column;text-align:center}
    .logo{width:100px;height:100px;margin:0 auto}
    .key-box{font-size:14px;flex-direction:column}
    .btn{width:100%;margin:10px 0 0}
  }
</style>
